    const location = useLocation();
    const [showMenu, setShowMenu] = useState(false);

  if (location.pathname === '/') {
    return null;
  }



    return <div className="nav">
            <img src={ImageNav} alt='r&m-title'></img>
                <div>
                    <SearchBar
                        onSearch = {props.onSearch}
                    />
